import { Component, OnInit } from '@angular/core';
import { Observable } from 'rxjs';
import { Recarga } from 'src/app/domain/recarga';
import { ClienteService } from 'src/app/services/cliente.service';
import { RecargaService } from 'src/app/services/recarga.service';

@Component({
  selector: 'app-recargas-mostrar',
  templateUrl: './recargas-mostrar.component.html',
  styleUrls: ['./recargas-mostrar.component.css']
})
export class RecargasMostrarComponent{
  usuario = {
    id: '',
    username: '',
    firstName: '',
    lastName: '',
    email: '',
    password: '',
    phone: '',
    userStatus: 0
  };

  constructor( private clienteServicio: ClienteService) {}

  actualizarUsuario() {
    this.clienteServicio.actualizarCliente(this.usuario).subscribe(
      (response) => {
        console.log('Usuario enviado con éxito:', response);
        // Aquí puedes manejar la respuesta del servidor si es necesario
      },
      (error) => {
        console.error('Error al enviar el usuario:', error);
        // Aquí puedes manejar el error si es necesario
      }
    );
  }
}
<div>
  <label for="id">ID:</label>
  <input type="text" id="id" name="id" [(ngModel)]="usuario.id"><br><br>

  <label for="username">Username:</label>
  <input type="text" id="username" name="username" [(ngModel)]="usuario.username"><br><br>

  <label for="firstName">First Name:</label>
  <input type="text" id="firstName" name="firstName" [(ngModel)]="usuario.firstName"><br><br>

  <label for="lastName">Last Name:</label>
  <input type="text" id="lastName" name="lastName" [(ngModel)]="usuario.lastName"><br><br>

  <label for="email">Email:</label>
  <input type="text" id="email" name="email" [(ngModel)]="usuario.email"><br><br>

  <label for="password">Password:</label>
  <input type="password" id="password" name="password" [(ngModel)]="usuario.password"><br><br>

  <label for="phone">Phone:</label>
  <input type="text" id="phone" name="phone" [(ngModel)]="usuario.phone"><br><br>

  <label for="userStatus">User Status:</label>
  <input type="number" id="userStatus" name="userStatus" [(ngModel)]="usuario.userStatus"><br><br>

  <button (click)="actualizarUsuario()">Enviar Usuario</button>
</div>
